using System;
using DjLive.Sdk;
using DjLive.Sdk.Model;
using DjLive.SdkModel;
using DjLive.SdkModel.Model;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace SdkUnitTest
{
    [TestClass]
    public class LogoTemplateTest
    {
        private const string Base64String =
                "data:image/png;base64,"
            ;

        private const string Base64String2 =
                "data:image/jpeg;base64,"
            ;
        private LogoTemplateModel DefaultModel = new LogoTemplateModel()
        {
          Name = "TestLogoTemplate",
          Base64String = Base64String,
          Height = 100,
          Width = 100
        };
        [TestMethod]
        public void GetLogoTemplateTest()
        {
            TokenManager.GetInstance().InitServicePoint(GlobalSetting.ServerPoint, HttpScheme.Http);
            var logResult = TokenManager.GetInstance().UpdateToken("admin", "admin").Result;
            var add = ApiManager.GetInstance().LogoTemplateService.CreateLogoTemplateModel(DefaultModel);
            Assert.AreEqual(ApiCode.Success, add.ApiCode);
            var defaults = ApiManager.GetInstance().LogoTemplateService.GetLogoTemplateById(add?.Content?.Id);
            Assert.AreEqual(ApiCode.Success,defaults.ApiCode);
            Assert.AreEqual(add?.Content?.Id, defaults?.Content?.Id );
            var delete = ApiManager.GetInstance().LogoTemplateService.DeleteLogoTemplateModel(add.Content?.Id);

        }
        [TestMethod]
        public void AddLogoTemplateTest()
        {
            TokenManager.GetInstance().InitServicePoint(GlobalSetting.ServerPoint, HttpScheme.Http);
            var logResult = TokenManager.GetInstance().UpdateToken("admin", "admin").Result;
            var add = ApiManager.GetInstance().LogoTemplateService.CreateLogoTemplateModel(DefaultModel);
            Assert.AreEqual( ApiCode.Success,add.ApiCode);
            Assert.IsNotNull(add.Content);
            Assert.AreEqual(DefaultModel?.Name, add.Content?.Name);
            ApiManager.GetInstance().LogoTemplateService.DeleteLogoTemplateModel(add.Content?.Id);
            var delete = ApiManager.GetInstance().LogoTemplateService.DeleteLogoTemplateModel(add.Content?.Id);
        }

        [TestMethod]
        public void DeleteLogoTemplateTest()
        {
            TokenManager.GetInstance().InitServicePoint(GlobalSetting.ServerPoint, HttpScheme.Http);
            var logResult = TokenManager.GetInstance().UpdateToken("admin", "admin").Result;
            var add = ApiManager.GetInstance().LogoTemplateService.CreateLogoTemplateModel(DefaultModel);
            var delete = ApiManager.GetInstance().LogoTemplateService.DeleteLogoTemplateModel(add.Content?.Id);
            Assert.AreEqual(ApiCode.Success, delete.ApiCode);
            Assert.AreEqual(DefaultModel.Name, delete.Content?.Name);
        }

        [TestMethod]
        public void UpdateLogoTemplateTest()
        {
            TokenManager.GetInstance().InitServicePoint(GlobalSetting.ServerPoint, HttpScheme.Http);
            var logResult = TokenManager.GetInstance().UpdateToken("admin", "admin").Result;
            var add = ApiManager.GetInstance().LogoTemplateService.CreateLogoTemplateModel(DefaultModel);
            add.Content.Base64String = Base64String2;
            var update = ApiManager.GetInstance().LogoTemplateService.UpdateLogoTemplateModel(add.Content?.Id, add.Content);
            Assert.AreEqual(ApiCode.Success, update.ApiCode);
            Assert.AreEqual(add.Content.Base64String, update.Content?.Base64String);

            var delete = ApiManager.GetInstance().LogoTemplateService.DeleteLogoTemplateModel(add.Content?.Id);
        }

    }
}
